css:
.syntax--bold {
  font-weight: bold;
}
.syntax--italic {
  font-style: italic;
}
.syntax--underline {
  text-decoration: underline;
}
.archive-editor {
  background-color: #1f1f1f;
  overflow: auto;
  contain: strict;
}
.archive-editor .archive-container {
  height: 100%;
  width: 100%;
}
.archive-editor .archive-container .inset-panel {
  border-width: 0;
}
.archive-editor .archive-container .inset-panel .panel-heading {
  border-radius: 0;
}
.archive-editor .archive-container .inset-panel .archive-tree {
  padding: 5px;
}
